      const text = `21歳からITに関して興味を持ち始め、プログラミングを学び始めた現在22歳の猫好きな学生。趣味は筋トレでフィジーク大会に向けて日々トレーニング中。\nフロントエンジニアを目指しReactを猛勉強中。またKotlin、NoCodeツールのBubbleでの開発経験あり。帰国子女であるため英語で会話可能。`



    return (
      <div>
        <div className='me'>
          <div className='me-information'>
            <h2>Kei Nakamura</h2>
            <div className='catimage'>
              <img src={catImage} />
              <div className='text'>
                {text}
              </div>

              <div className='subtitle'>
                Things I Created
                <div className='thing-created'>
                  <div className='websites'>
                    {this.props.title}
                    aaa
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default HomePage;
